import React from 'react';
import { Card, Avatar, Button } from 'antd'

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">twittwit<br />0</div>,
                <div key="followings">팔로잉<br />0</div>,
                <div key="followers">팔로워<br />0</div>


            ]}

        >
            <Card.Meta
                avatar={<Avatar>CH</Avatar>}
                title="Chloe"

            />
            <Button>로그아웃</Button>

        </Card>
    )
}

export default UserProfile
